<h1>Owning library has blocked execution of the VI</h1>
<p class="Body">This error occurs when the library that contains the VI blocks execution of all VIs in the library. To correct this error, you must correct any errors listed for the library in the <a href="../lvdialog/Error_List_Dialog_Box.html">Error list</a> window.</p>
